import React from "react";

//Material UI
import { Button, Grid } from "@material-ui/core";
import { Link } from "react-router-dom";

const HomeButton = ({ content, startIcon, endIcon, color, to }) => {
  return (
    <Grid
      container
      justify="center"
      style={{
        margin: "22px",
      }}
    >
      <Link to={to}>
        <Button
          data-aos="fade-down"
          className="
        animate__animated
        animate__bounce"
          variant="contained"
          color={color}
          startIcon={startIcon}
          endIcon={endIcon}
        >
          {content}
        </Button>
      </Link>
    </Grid>
  );
};

export default HomeButton;
